(2, 'id', '*', 'translatable', 'categorymodel.name.wqT21gVry92dE3sk', 'Energi dan Bangunan Hijau', 0, 0, '2020-08-18 18:48:47', '2020-08-18 18:48:47'),
(3, 'en', '*', 'translatable', 'categorymodel.name.wqT21gVry92dE3sk', 'Energy and Green Building', 1, 0, '2020-08-18 18:48:48', '2020-08-24 16:38:27'),
(4, 'id', '*', 'translatable', 'categorymodel.description.jLcAKY2iRJywBKu8', 'Penggunaan energi listrik dan bahan bakar menyumbang 92,5% emisi Gas Rumah Kaca di Jakarta. Dukung DKI Jakarta mengurangi emisi di sektor energi!', 0, 0, '2020-08-18 18:50:53', '2020-08-23 09:08:44'),
(5, 'en', '*', 'translatable', 'categorymodel.description.jLcAKY2iRJywBKu8', 'Energy consumption from electricity and fossil fuel contribute 92,5 % of greenhouse gas (GHG) emission in Jakarta. Support DKI Jakarta to reduce emissions from the energy sector!', 1, 0, '2020-08-18 18:50:53', '2020-08-24 16:38:27'),
(6, 'id', '*', 'translatable', 'postmodel.title.xFjREeURV2zBIkG2', 'Energi dan Bangunan Hijau', 0, 0, '2020-08-23 09:08:44', '2020-08-23 09:08:44'),
(7, 'en', '*', 'translatable', 'postmodel.title.xFjREeURV2zBIkG2', 'Energy and Green Building', 1, 0, '2020-08-23 09:08:44', '2020-08-24 16:38:27'),
(8, 'id', '*', 'translatable', 'postmodel.description.vvWBQohGmlCkAz4H', 'Penggunaan energi listrik dan bahan bakar menyumbang 92,5% emisi Gas Rumah Kaca di Jakarta. Dukung DKI Jakarta mengurangi emisi di sektor energi!', 0, 0, '2020-08-23 09:08:44', '2020-08-23 09:08:44'),
(9, 'en', '*', 'translatable', 'postmodel.description.vvWBQohGmlCkAz4H', 'Energy consumption from electricity and fossil fuel contribute 92,5 % of greenhouse gas (GHG) emission in Jakarta. Support DKI Jakarta to reduce emissions from the energy sector!', 1, 0, '2020-08-23 09:08:44', '2020-08-24 16:38:27'),
(10, 'id', '*', 'translatable', 'postmodel.content.aS7mY0DZDODUUHlj', '<p style=\"text-align: center;\">Energi merupakan sektor penyumbang emisi Gas Rumah Kaca (GRK) terbesar sejak tahun 2010. Pada tahun 2018, sebanyak 92,5% dari total emisi DKI Jakarta berasal dari sektor energi. Oleh karena itu, aksi - aksi mitigasi di bidang energi menjadi penting untuk mendukung pembangunan rendah karbon di DKI Jakarta.</p>\r\n<p style=\"text-align: center;\"><em>Sumber: Dinas Lingkungan Hidup DKI Jakarta, 2019</em></p>', 0, 0, '2020-08-23 16:28:04', '2020-08-24 16:38:27'),
(11, 'en', '*', 'translatable', 'postmodel.content.aS7mY0DZDODUUHlj', '<p style=\"text-align: center;\">Energy sector is the biggest contributor of greenhouse gas (GHG) emission in Jakarta since 2010. In 2018, the energy sector accounted for 92.5% of its total emission. Therefore, mitigation actions in the energy sector is important to support low carbon development in DKI Jakarta.</p>\r\n<p style=\"text-align: center;\"><em>Source: DKI Jakarta Environment Agency, 2019</em></p>', 1, 0, '2020-08-23 16:28:04', '2020-08-24 16:38:27'),
(12, 'id', '*', 'translatable', 'categorymodel.name.MJ6H8NfN4TlCUCgW', 'Transportasi dan Kualitas Udara', 0, 0, '2020-08-24 16:21:25', '2020-08-24 16:21:25'),
(13, 'en', '*', 'translatable', 'categorymodel.name.MJ6H8NfN4TlCUCgW', 'Transportation and Air Quality', 1, 0, '2020-08-24 16:21:25', '2020-08-24 16:47:50'),
(14, 'id', '*', 'translatable', 'categorymodel.description.oSjmJNjipDGpEStT', 'Penggunaan kendaraan bermotor menyebabkan polusi udara dan meningkatnya emisi GRK di DKI Jakarta. Dukung DKI Jakarta meningkatkan kualitas udara dan mengurangi emisi gas rumah kaca !', 0, 0, '2020-08-24 16:21:25', '2020-08-24 16:21:25'),
(15, 'en', '*', 'translatable', 'categorymodel.description.oSjmJNjipDGpEStT', 'Motor vehicles emit GHG emission and pollution in DKI Jakarta. Support DKI Jakarta to increase air quality and reduce GHG emission!', 1, 0, '2020-08-24 16:21:25', '2020-08-24 16:47:50'),
(16, 'id', '*', 'translatable', 'postmodel.title.cIfRFCkEMpEbeOqB', 'Transportasi dan Kualitas Udara', 0, 0, '2020-08-24 16:21:25', '2020-08-24 16:21:25'),
(17, 'en', '*', 'translatable', 'postmodel.title.cIfRFCkEMpEbeOqB', 'Transportation and Air Quality', 1, 0, '2020-08-24 16:21:25', '2020-08-24 16:47:50'),
(18, 'id', '*', 'translatable', 'postmodel.content.0ydzYLIEH7tYgFAx', '<p style=\"text-align: center;\">Penggunaan energi fosil sebagai bahan bakar berkontribusi terhadap emisi Gas Rumah Kaca (GRK) sebesar 23,05% dari total emisi pada tahun 2018 di DKI Jakarta pada sektor transportasi.. Aktivitas transportasi juga menyumbang 75% polusi udara di DKI Jakarta. Menggunakan transportasi umum, bersepeda, berjalan kaki serta mengurangi pemakaian kendaraan pribadi merupakan aksi - aksi yang dapat dilakukan untuk mengurangi Emisi GRK di DKI Jakarta.</p>\r\n<p style=\"text-align: center;\"><em>Sumber: Dinas Lingkungan Hidup DKI Jakarta, 2019</em></p>', 0, 0, '2020-08-24 16:21:25', '2020-08-24 16:47:50'),
(19, 'en', '*', 'translatable', 'postmodel.content.0ydzYLIEH7tYgFAx', '<p style=\"text-align: center;\">Fossil fuel use by vehicles contributed to 23,05% of overall greenhouse gas (GHG) emission of DKI Jakarta in 2018. Moreover, 75% of air pollution in DKI Jakarta is due to land transportation activities. Using public transportation, walking, cycling and reducing private vehicle use are some actions to reduce GHG emission from the transportation sector.</p>\r\n<p style=\"text-align: center;\"><em>Source: DKI Jakarta Environment Agency, 2019</em></p>', 1, 0, '2020-08-24 16:21:25', '2020-08-24 16:47:50'),
(20, 'id', '*', 'translatable', 'postmodel.description.kZufndUjVsBQAEsJ', 'Penggunaan kendaraan bermotor menyebabkan polusi udara dan meningkatnya emisi GRK di DKI Jakarta. Dukung DKI Jakarta meningkatkan kualitas udara dan mengurangi emisi gas rumah kaca !', 0, 0, '2020-08-24 16:21:25', '2020-08-24 16:21:25'),
(21, 'en', '*', 'translatable', 'postmodel.description.kZufndUjVsBQAEsJ', 'Motor vehicles emit GHG emission and pollution in DKI Jakarta. Support DKI Jakarta to increase air quality and reduce GHG emission!', 1, 0, '2020-08-24 16:21:25', '2020-08-24 16:47:50'),
(22, 'id', '*', 'translatable', 'categorymodel.name.4CiRrCF7Lylb5VsQ', 'Limbah Padat (Sampah)', 0, 0, '2020-08-24 16:49:56', '2020-08-24 16:49:56'),
(23, 'en', '*', 'translatable', 'categorymodel.name.4CiRrCF7Lylb5VsQ', 'Solid Waste', 0, 0, '2020-08-24 16:49:56', '2020-08-24 16:49:56'),
(24, 'id', '*', 'translatable', 'categorymodel.description.yDbypEPx1rgJNKvQ', 'DKI Jakarta memiliki target untuk mengurangi 30% sampah dan mengelola 70% sampah. Dukung DKI Jakarta mencapai target tersebut!', 0, 0, '2020-08-24 16:49:56', '2020-08-24 16:49:56'),
(25, 'en', '*', 'translatable', 'categorymodel.description.yDbypEPx1rgJNKvQ', 'DKI Jakarta has a target to reduce 30% of waste and to manage 70% of waste. Support DKI Jakarta to achieve those targets!', 0, 0, '2020-08-24 16:49:56', '2020-08-24 16:49:56'),
(26, 'id', '*', 'translatable', 'postmodel.title.BVLUPOWJcpuyhIfR', 'Limbah Padat (Sampah)', 0, 0, '2020-08-24 16:49:56', '2020-08-24 16:49:56'),
(27, 'en', '*', 'translatable', 'postmodel.title.BVLUPOWJcpuyhIfR', 'Solid Waste', 0, 0, '2020-08-24 16:49:56', '2020-08-24 16:49:56'),
(28, 'id', '*', 'translatable', 'postmodel.content.8yIkU5JvjjATVm23', '<p style=\"text-align: center;\">Limbah padat (sampah) merupakan masalah prioritas di DKI Jakarta. DKI Jakarta menghasilkan sampah sebesar 7600 ton sampah per hari. Sebanyak 90% dari sampah padat DKI Jakarta diangkut dan diolah di Tempat Pengolahan Sampah Terpadu (TPST) Bantar Gebang dengan sistem Landfill. Pada saat ini, kapasitas TPST Bantar Gebang akan mencapai kapasitas maksimum. Oleh karena itu pengurangan dan pengolahan sampah di sumber (rumah tangga) menjadi penting dalam strategi DKI Jakarta untuk mengurangi jumlah sampah.</p>\r\n<p style=\"text-align: center;\"><em>Sumber: Dinas Lingkungan Hidup DKI Jakarta, 2019</em></p>', 0, 0, '2020-08-24 16:49:56', '2020-08-24 16:49:56'),
(29, 'en', '*', 'translatable', 'postmodel.content.8yIkU5JvjjATVm23', '<p style=\"text-align: center;\">Solid waste is one of the priority issues in DKI Jakarta. DKI Jakarta generates 7600 tonnes waste per day. 90% of that waste is transported to the landfill final disposal site in Bantar Gebang located in Bekasi City. It is foreseen that the capacity of the landfill will reach its maximum capacity. Therefore, waste reduction and management at source is important in the overall strategy of DKI Jakarta in significantly reducing its waste generation and disposal.&nbsp;</p>\r\n<p style=\"text-align: center;\"><em>Source: DKI Jakarta Environment Agency, 2019</em></p>', 0, 0, '2020-08-24 16:49:56', '2020-08-24 16:49:56'),
(30, 'id', '*', 'translatable', 'postmodel.description.kg26Si3iOw4o6vUQ', 'DKI Jakarta memiliki target untuk mengurangi 30% sampah dan mengelola 70% sampah. Dukung DKI Jakarta mencapai target tersebut!', 0, 0, '2020-08-24 16:49:56', '2020-08-24 16:49:56'),
(31, 'en', '*', 'translatable', 'postmodel.description.kg26Si3iOw4o6vUQ', 'DKI Jakarta has a target to reduce 30% of waste and to manage 70% of waste. Support DKI Jakarta to achieve those targets!', 0, 0, '2020-08-24 16:49:56', '2020-08-24 16:49:56'),
