(116, 'id', '*', 'translatable', 'postmodel.content.I7rB40j1s7E3Bjhc', '<p style=\"text-align: justify;\">Lampu LED dapat menghemat pemakaian listrik sekitar 90% dibandingkan lampu pijar dan sekitar 50% dari lampu CFL. Lampu LED juga lebih tahan lama dari lampu pijar dan CFL</p>\r\n<p>Sumber : <a href=\"https://www.sciencedirect.com/science/article/abs/pii/S0378778813005367\" target=\"_blank\" rel=\"noopener\">https://www.sciencedirect.com/science/article/abs/pii/S0378778813005367</a></p>', 0, 0, '2020-08-24 20:05:09', '2020-08-24 20:13:30'),
(117, 'en', '*', 'translatable', 'postmodel.content.I7rB40j1s7E3Bjhc', '<p style=\"text-align: justify;\">LED bulbs allow saving up to 90% energy compare to Incandescent bulbs and up to 50% compare to CFL bulb. In addition, a LED bulb has longer life span compare to others.</p>\r\n<p>Source: <a href=\"https://www.sciencedirect.com/science/article/abs/pii/S0378778813005367\" target=\"_blank\" rel=\"noopener\">https://www.sciencedirect.com/science/article/abs/pii/S0378778813005367</a></p>', 1, 0, '2020-08-24 20:05:09', '2020-08-24 20:13:30'),
