(128, 'id', '*', 'translatable', 'postmodel.content.13Rwpp2Za11x9raT', '<p>Tahukah kamu, pada AC tercantum bintang sebagai Label Tanda Hemat Energi. AC yang memiliki bintang 4 merupakan AC yang paling hemat energi dan dapat menghemat biaya listrik.</p>\r\n<p>Sumber: <a href=\"http://iesr.or.id/mengenal-air-conditioner-ac-yang-hemat-dan-efisien-energi-2/\" target=\"_blank\" rel=\"noopener\">http://iesr.or.id/mengenal-air-conditioner-ac-yang-hemat-dan-efisien-energi-2/</a></p>', 0, 0, '2020-08-24 20:12:37', '2020-08-24 20:14:19'),
(129, 'en', '*', 'translatable', 'postmodel.content.13Rwpp2Za11x9raT', '<p>Do you know that there is star symbol in AC as an energy-efficient label? AC with 4 stars is the most energy-efficient AC and can save your electricity bill.</p>\r\n<p>Sumber: <a href=\"http://iesr.or.id/mengenal-air-conditioner-ac-yang-hemat-dan-efisien-energi-2/\" target=\"_blank\" rel=\"noopener\">http://iesr.or.id/mengenal-air-conditioner-ac-yang-hemat-dan-efisien-energi-2/</a></p>', 1, 0, '2020-08-24 20:12:37', '2020-08-24 20:14:19'),
