(138, 'id', '*', 'translatable', 'postmodel.content.Z294jROVfA4lOb1k', '<p>TV LED 32 inch mengkonsumsi energi 35% lebih sedikit dari TV LCD dan 65% lebih sedikit dari TV Plasma dengan ukuran yang sama. Ukuran layar juga perlu dipertimbangkan saat akan membeli TV karena akan berpengaruh terhadap konsumsi energi dan tagihan listrik</p>\r\n<p>Sumber: <a href=\"http://energyusecalculator.com/electricity_lcdleddisplay.htm\" target=\"_blank\" rel=\"noopener\">http://energyusecalculator.com/electricity_lcdleddisplay.htm</a></p>', 0, 0, '2020-08-24 20:16:22', '2020-08-24 20:16:22'),
(139, 'en', '*', 'translatable', 'postmodel.content.Z294jROVfA4lOb1k', '<p>A 32-inch LED TV consumes less energy compared to LCD TV by 35% and to plasma TV by 65% with the same screen size. Keep in mind to consider screen size when you want to buy TV, as screen size also influences the energy consumption and electricity bill.</p>\r\n<p>Sumber: <a href=\"http://energyusecalculator.com/electricity_lcdleddisplay.htm\" target=\"_blank\" rel=\"noopener\">http://energyusecalculator.com/electricity_lcdleddisplay.htm</a></p>', 0, 0, '2020-08-24 20:16:22', '2020-08-24 20:16:22'),
