(148, 'id', '*', 'translatable', 'postmodel.content.CF8KV9UsYnIuqzfQ', '<p style=\"text-align: justify;\">Berjalan kaki dapat menghemat ongkos transportasi, menjaga kesehatan tubuh dan menyegarkan pikiran.</p>\r\n<p>Sumber: <a href=\"https://www.healthline.com/health/benefits-of-walking\" target=\"_blank\" rel=\"noopener\">https://www.healthline.com/health/benefits-of-walking</a></p>', 0, 0, '2020-08-24 20:19:48', '2020-08-24 20:19:48'),
(149, 'en', '*', 'translatable', 'postmodel.content.CF8KV9UsYnIuqzfQ', '<p>Walking helps you save money, keep you fit and refresh your mind!</p>\r\n<p>Sumber: <a href=\"https://www.healthline.com/health/benefits-of-walking\" target=\"_blank\" rel=\"noopener\">https://www.healthline.com/health/benefits-of-walking</a></p>', 0, 0, '2020-08-24 20:19:48', '2020-08-24 20:19:48'),
