(158, 'id', '*', 'translatable', 'postmodel.content.SYs21GV3og034PFk', '<p style=\"text-align: justify;\">Bersepeda minimal 30 menit setiap hari dapat mengurangi risiko stroke, serangan jantung, dan tekanan darah tinggi; meningkatkan kekuatan otot, menjaga berat badan dan menurunkan tingkat stress.</p>\r\n<p>Sumber : <a href=\"https://hellosehat.com/hidup-sehat/tips-sehat/manfaat-bersepeda-bagi-kesehatan/\" target=\"_blank\" rel=\"noopener\">https://hellosehat.com/hidup-sehat/tips-sehat/manfaat-bersepeda-bagi-kesehatan/</a></p>', 0, 0, '2020-08-24 20:22:30', '2020-08-24 20:22:30'),
(159, 'en', '*', 'translatable', 'postmodel.content.SYs21GV3og034PFk', '<p style=\"text-align: justify;\">Cycling for a minimum of 30 mins reduces risk of stroke, heart attack and high blood pressure, increases muscle strength, maintains body weight, and reduces stress levels.</p>\r\n<p style=\"text-align: justify;\">Sumber : <a href=\"https://hellosehat.com/hidup-sehat/tips-sehat/manfaat-bersepeda-bagi-kesehatan/\" target=\"_blank\" rel=\"noopener\">https://hellosehat.com/hidup-sehat/tips-sehat/manfaat-bersepeda-bagi-kesehatan/</a></p>', 0, 0, '2020-08-24 20:22:31', '2020-08-24 20:22:31'),
