(168, 'id', '*', 'translatable', 'postmodel.content.qIxAhIIQNqbqVu9U', '<p style=\"text-align: justify;\">Transportasi umum adalah moda transportasi yang lebih ramah lingkungan dibandingkan kendaraan pribadi. Kamu juga dapat menghemat uang dan energi, jika bepergian dengan transportasi umum.</p>', 0, 0, '2020-08-24 20:28:35', '2020-08-24 20:28:35'),
(169, 'en', '*', 'translatable', 'postmodel.content.qIxAhIIQNqbqVu9U', '<p style=\"text-align: justify;\">Public transportation is an environmentally friendly way to get round. By using public transportation, you can save your money and energy.</p>', 1, 0, '2020-08-24 20:28:35', '2020-08-24 20:44:37'),
