(196, 'id', '*', 'translatable', 'slidermodel.description.SVaflwkNcLKdJ084', '<h2 style=\"text-align: center;\">TUNJUKAN AKSIMU<br />UNTUK MENDUKUNG JAKARTA<br />MENURUNKAN EMISI GAS RUMAH KACA<br />(GRK)</h2>\r\n<h3 style=\"text-align: center;\">[count_people_pledged class=\"yellow-color\"] orang sudah membuat [count_pledged class=\"yellow-color\"] janji</h3>\r\n<div class=\"slider-btn\" style=\"text-align: center;\"><a class=\"btn btn-default\" role=\"button\" href=\"//ikhtiar-jakarta.local/tentang-ikhtiar-jakarta\">PELAJARI LEBIH LANJUT</a> &nbsp; <a class=\"btn btn-default\" role=\"button\" href=\"//ikhtiar-jakarta.local/pledges\">BUAT JANJI SEKARANG</a></div>', 0, 0, '2020-08-25 05:30:05', '2020-08-30 11:06:04'),
