(315, 'id', '*', 'translatable', 'postmodel.title.blctpVL8SwS9Wkhr', 'Tentang Ikhtiar Jakarta', 0, 0, '2020-08-27 01:01:42', '2020-08-27 01:01:42'),
(316, 'en', '*', 'translatable', 'postmodel.title.blctpVL8SwS9Wkhr', 'About Ikhtiar Jakarta', 1, 0, '2020-08-27 01:01:42', '2020-08-28 20:38:03'),
(317, 'id', '*', 'translatable', 'postmodel.content.7EFlCSQXalgl13Q7', '<p style=\"text-align: justify;\"><em><strong>Ikhtiar Jakarta</strong></em> adalah dokumen yang berisi strategi dan rencana aksi terpadu yang menggabungkan aksi mitigasi dan adaptasi untuk mengatasi krisis iklim di DKI Jakarta. &nbsp;Dalam dokumen ini terdapat komitmen - komitmen pemangku kepentingan pada sektor - sektor perubahan iklim, seperti energi dan bangunan hijau, transportasi dan kualitas udara, limbah padat dan cair, air, ruang terbuka hijau, pertanian perkotaan, kesehatan dan kebencanaan.</p>\r\n<p style=\"text-align: justify;\" align=\"justify\">Janji personal aksi iklim yang tersedia dalam situs web ini merupakan salah satu bentuk kontribusi individu untuk menurunkan emisi GRK dengan melakukan aksi ramah lingkungan dalam kehidupan sehari - hari. Janji aksi individu ini akan menjadi bagian yang tidak terpisahkan dalam pelaporan aksi Iklim di Provinsi DKI Jakarta</p>', 0, 0, '2020-08-27 01:01:42', '2020-08-27 01:04:53'),
(318, 'en', '*', 'translatable', 'postmodel.content.7EFlCSQXalgl13Q7', '<p style=\"text-align: justify;\" align=\"justify\"><em><strong>Ikhtiar Jakarta</strong></em> is a document containing an integrated strategy and climate action plan, including mitigation and adaptation actions to address the climate crisis in DKI Jakarta. The document outlines the stakeholders&rsquo; commitment on various climate change sectors including energy and green building, transport and air quality, waste management, clean water, green spaces and urban farming, as well as health and disaster management.</p>\r\n<p style=\"text-align: justify;\" align=\"justify\">Through this website, individuals can pledge to show their contribution in reducing GHG emission by implementing environmental action in daily life. This pledge will be an inseparable part of climate action reporting in DKI Jakarta Province.</p>', 1, 0, '2020-08-27 01:01:42', '2020-08-28 20:38:03'),
(319, 'id', '*', 'translatable', 'postmodel.description.TbjdwaKqiO0NzG00', 'Ikhtiar Jakarta adalah dokumen yang berisi strategi dan rencana aksi terpadu yang menggabungkan aksi mitigasi dan adaptasi untuk mengatasi krisis iklim di DKI Jakarta.  Dalam dokumen ini terdapat komitmen - komitmen pemangku kepentingan pada sektor - sektor perubahan iklim, seperti energi dan bangunan hijau, transportasi dan kualitas udara, limbah padat dan cair, air, ruang terbuka hijau, pertanian perkotaan, kesehatan dan kebencanaan.', 0, 0, '2020-08-27 01:01:42', '2020-08-27 01:01:42'),
(320, 'en', '*', 'translatable', 'postmodel.description.TbjdwaKqiO0NzG00', 'Ikhtiar Jakarta is a document containing an integrated strategy and climate action plan, including mitigation and adaptation actions to address the climate crisis in DKI Jakarta. The document outlines the stakeholders’ commitment on various climate change sectors including energy and green building, transport and air quality, waste management, clean water, green spaces and urban farming, as well as health and disaster management.', 1, 0, '2020-08-27 01:01:42', '2020-08-28 20:38:03'),
(321, 'id', '*', 'translatable', 'postmodel.title.VNhrgNTUi6bqBTal', 'Tentang ACP', 0, 0, '2020-08-27 01:04:23', '2020-08-27 01:04:23'),
(322, 'en', '*', 'translatable', 'postmodel.title.VNhrgNTUi6bqBTal', 'About ACP', 0, 0, '2020-08-27 01:04:23', '2020-08-27 01:04:23'),
(323, 'id', '*', 'translatable', 'postmodel.content.nXfya83TaaL73DKS', '<p style=\"text-align: justify;\"><em><strong>Ambitious City Promise</strong></em> (ACP) adalah proyek yang mendapat bantuan pendanaan dari German Federal Ministry for the Environment, Nature Conservation, Building and Nuclear Safety (BMUB) melalui program International Climate Initiative (IKI). Proyek ini dilaksanakan oleh ICLEI - Local Governments for Sustainability bekerjasama dengan Seoul Metropolitan Government (SMG). Proyek ini bertujuan untuk meningkatkan komitmen pemerintah daerah untuk menurunkan emisi Gas Rumah Kaca melalui rencana aksi dan komitmen perubahan iklim yang partisipatif dan inklusif di kota &ndash; kota terpilih di Indonesia, Filipina, dan Vietnam. Di Indonesia proyek ini dilaksanakan di DKI Jakarta sebagai kota model, serta Kota Tangerang dan Bekasi sebagai kota satelit.</p>', 0, 0, '2020-08-27 01:04:23', '2020-08-27 01:04:23'),
(324, 'en', '*', 'translatable', 'postmodel.content.nXfya83TaaL73DKS', '<p style=\"text-align: justify;\"><strong><em>Ambitious City Promise</em></strong> (ACP) project is funded by Federal Ministry for the Environment, Nature Conservation, Building and Nuclear Safety (BMUB) through International Climate Initiative (IKI). The project is implemented by ICLEI - Local Governments for Sustainability in close cooperation with Seoul Metropolitan Government (SMG). The project aims to establish a strong commitment of the local government to reduce greenhouse gas (GHG) emission through participatory and inclusive local climate action in selected cities in Indonesia, the Philippines and Vietnam. In Indonesia, the project is implemented in DKI Jakarta as a model city, Tangerang and Bekasi City as satellite cities.</p>', 0, 0, '2020-08-27 01:04:23', '2020-08-27 01:04:23'),
(325, 'id', '*', 'translatable', 'postmodel.description.1HPTLqIFZTRxa1o0', 'Ambitious City Promise (ACP) adalah proyek yang mendapat bantuan pendanaan dari German Federal Ministry for the Environment, Nature Conservation, Building and Nuclear Safety (BMUB) melalui program International Climate Initiative (IKI)', 0, 0, '2020-08-27 01:04:23', '2020-08-27 01:04:23'),
